import axiosConfig from"./axiosConfig";import axios from"axios";const loginApi=async function(url,login,password){try{const res=await axiosConfig.post(url,{login:login,password:password});if(200!==res.status)throw new Error("Problem...",res);return console.log(JSON.stringify(res.data)),JSON.stringify(res.data)}catch(error){return console.error("Error :",error),!1}};export default loginApi;